import React, { useState } from "react";
import Title from "./components/title";
import Form from "./components/form";

const Register = () => {
  return (
    <div className="register-page">
      <div>
        <Title />
      </div>
      <div>
        <Form />
      </div>
    </div>
  );
};

export default Register;
